column9:
Непокретност л.н. број: 2497 К.О. Чортановци, на  парцели број 94/2 која се састоји од:
-породична стамбена зграда , површине 29 м2, број дела 1, ул. Владе Грбића, на којој  извршни дужник Горан Обрадовић, има право својине, са обимом удела од 1/2
-земљиште под зградом и другим објектом, површине 29 м2, број дела 1, ул. Владе Грбића, на којој  извршни дужник Горан Обрадовић, има право својине, са обимом удела од 1/2;
- земљиште уз зграду и други објект, површине 500 м2, број дела 2, ул. Владе Грбића, на којој  извршни дужник Горан Обрадовић, има право својине, са обимом удела од 1/2;
-њива 5. класе, површине 1324 м2, број дела 3, ул. Владе Грбића, на којој  извршни дужник Горан Обрадовић, има право својине, са обимом удела од 1/2;

-	Породичне стамбене зграде - куће, кућни бр. 27-27а, број објекта 1, објекат преузет из земљишне књиге у улици Емила Золе 27, а која се састоји од следећих посебних делова:
-	петособног стана, број посебног дела 1, евиденцијски број 3, у приземљу, корисне површине 121 m2;
-	петособног стана, број посебног дела 2, евиденцијски број 4, у приземљу, корисне површине 121 m2; 
-	гараже број посебног дела 1, евиденцијски број 1, у приземљу, корисне површине 16 m2;
-	гараже, број посебног дела 2, евиденцијски број 2, у приземљу, корисне површине 16 m2;

Стамбено – пословнa зградa – зграда пословних услуга (бр. објекта 1), Пр + 1, површине у основи 265м2 (уписане корисне површине 451м2, уписане грађевинске површине 540м2), објекат има одобрење за градњу а нема одобрење за употребу, која се налази у ул. Николе Пашића бр. 53 и која се састоји од: 

пословног простора угоститељства – пословни простор у приземљу бр. 1 (евиденцијски бр. 1) уписане корисне површине 245м2 и пословног простора угоститељства – пословни простор – угоститељски објекат бр. 2 (евиденцијски бр. 2) уписане корисне површине 207м2; 

са земљиштем под зградом и другим објектом – остало грађевинско земљиште у својини (бр. дела 1) површине 265м2 и са земљиштем уз зграду и други објекат – остало грађевинско земљиште у својини (бр. дела 2) површине 335м2;

све на кат. парцели бр. 2046/3, уписано у лист непокретности бр. 2776 КО Винча

Непокретност извршног дужника GOLDEN GARDEN DOO, Горњи Таванкут, Горњи Таванкут 966А, МБ: 08826005, уписана у лист непокретности број 5051 КО ТАВАНКУТ и то:
парцела број 7371 - земљиште под зградом - објектом, површине од 43а27м2, на којем је саграђена зграда пољопривреде - пословни објекат за складиштење воћа и поврћа, у улици Света Ана; земљиште под зградом - објектом, површине од 69м2, на којем је саграђен објекат пољопривреде - вага, у улици Света Ана; земљиште уз зграду - објекат, површине од 70а82м2, у улици Света Ана;
На парцели се налази и објекат – контролна кућица за колску вагу, површине од 20м2, и објекат – носач трафоа, и нису уписани у лист непокретности број 5051 КО ТАВАНКУТ, а исти су били предмет процене.
